import { Grid, Typography, Box, TextField, Button, Paper } from "@mui/material";

function App() {
  return (
    <Grid container direction="column">
      <Box
        sx={{
          height: "100vh",
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        <Typography variant="h1">Fato ou Fake?</Typography>
        <Typography variant="article">
          Um algorítimo de machine learning capaz
        </Typography>
      </Box>
      <Box
        sx={{
          height: "100vh",
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        <Box component={Paper} p={2} sx={{alignItems: 'center'}}>
          <Typography variant="article">
            Insira o texto da notícia no campo abaixo para verificar a
            veracidade da informação:
          </Typography>
          <TextField fullWidth sx={{ mt: 2 }} rows={10} multiline label='Titulo da Notícia' />
          <TextField fullWidth sx={{ mt: 2 }} rows={10} multiline label='Link da Notícia'/>

          <TextField fullWidth sx={{ mt: 2 }} rows={10} multiline label='Conteúdo da Notícia'/>
          <Button align='center'>Verificar</Button>
        </Box>
      </Box>
    </Grid>
  );
}

export default App;
